import React, { useState } from 'react';
import { connect } from 'react-redux';
import mapStoreToProps from '../../redux/mapStoreToProps';
import { Grid, Container, Typography } from "@material-ui/core";

function AdoptionSection(props) {
  return (
    <Grid xs={4} container justify="space-between" alignItems="center">
      {props.store.animalsReducer.map((animal, i) =>
      <div>
      <Typography>{animal.name}</Typography>
      <img src={animal.picture} />
      </div>
      )}
    </Grid>
  );
}

export default connect(mapStoreToProps)(AdoptionSection);
